    false,nt"url": null,nt"notes": "This narrative report for Horicon National
    Wildlife Refuge outlines Refuge accomplishments from May through August of 1946.
    The report begins by summarizing the weather conditions and water conditions during
    this period. Wildlife- including migratory birds, upland game birds, big game animals,
    furbearers, predators, rodents, raptors, fish, and reptiles- is also covered. The
    Refuge development and maintenance section discusses physical development, plantings,
    prescribed fires, and wildfires. Resource management is outlined; topics include
    grazing, and haying. The public relations section of the report describes recreational
    uses, Refuge visitors, and Refuge participation. N-R forms are attached.",nt"license_title":
